import React from 'react';
import { Jumbotron } from 'react-bootstrap';
import jumbo from './jumbo.jpg';

function Layar () {
    return (
        <div className="layar">
            <Jumbotron fluid>
            <img src={jumbo} height="600" width="100%" />
            </Jumbotron>
        </div>
    );
}

export default Layar;
